import React, { Component } from "react";

const style = {
    container: {
        width: '40%',
        height: 70,
        backgroundColor: "#FF5F5F",
        borderRadius: 10,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        marginTop: -35
    },
  title: {
    fontWeight: "light",
    textAlign: 'center',
    margin: 0,
    padding: 0,
    color: '#ffffff',
    fontSize: 20
  }
};

export class TodoMainTitle extends Component {
  render() {
    return (
      <div style={style.container}>
        <h6 style={style.title}>{"Task manager"}</h6>
      </div>
    );
  }
}

export default TodoMainTitle;
